//www.kinoheld.de/kino/tuebingen/kino-museum-tuebingen/show/81793?mode=widget&cid=NDM5MzUwMA&layout=movies&design=new&rb=0&showId=81793&sessid=uusu47q9iipk8h7e5gqm1mfmpl"}]}]}]}]},{"id":14,"title":"Mit Liebe und Chansons","slug":"mit-liebe-und-chansons","duration":"98 min","fsk":"Unknown","genre":"Drama, Komödie","originalTitle":"Ma mère, Dieu et Sylvie Vartan","production":"Frankreich","releaseDate":"27.11.2025","distributor":"Neue Visionen","director":"Ken Scott","description":"Paris in den 1960er Jahren: Esther Perez bringt ihr sechstes Kind zur Welt, den kleinen Roland. Er wird mit einer Fehlbildung am Fuß geboren. Die Ärzte sind sich sicher, dass Roland niemals richtig laufen wird. Doch Esther ist eine starke und sture Frau, die ihrem Kopf und vor allem ihrem Herzen folgt. Entgegen aller Ratschläge verspricht sie Roland, dass er an seinem ersten Schultag wie alle anderen Kinder auf eigenen Beinen in die Schule gehen wird. Roland wird ein glücklicher Mensch sein, dem es an nichts mangelt, dafür werde sie schon sorgen. Basta. Und Esther ist eine Mutter, die wahre Wunder vollbringen kann. Alles setzt sie nun daran, ihr Versprechen zu halten und schleppt Roland von Orthopäde zu Heilerin und wieder zurück. Mit unerschütterlichem Optimismus ist sie niemals um eine neue Strategie verlegen, die ihrem Sohn das Glück bescheren kann, auf eigenen Beinen zu stehen, selbst wenn der liebe Gott dabei eine Rolle spielen muss und ihre jüdische Großfamilie dazu verdammt ist, monatelang den heilsamen Klängen französischer Chansons zu lauschen.<br><br>MIT LIEBE UND CHANSONS ist die unglaubliche, aber wahre und mit viel Humor erzählte Geschichte von der größten Liebe, die es geben kann: die einer Mutter zu ihrem Kind. Hier gelingt eine großartige Familiensaga über die Hingabe und Kraft, die darin liegt, sich dem Schicksal gemeinsam zu stellen. Eine zutiefst berührende und warmherzige Tragikomödie, die den Pfaden der Liebe folgt und dem Publikum ein wundervolles Kinoerlebnis schenkt.","posterUrl":"https://static.kinoheld.de/images/film/mit-liebe-und-chansons-75221.v17500740443995.webp?w=352&h=528&fm=webp&q=90&fit=crop","actors":["David Ayala","Leïla Bekhti","Jonathan Cohen","Joséphine Japy"],"attributes":["Apéro Film"],"dates":[{"date":"2025-11-26","theaters":[{"name":"Kino Museum","rooms":[{"name":"Saal Arsenal","showings":[{"time":"18:00","endTime":"19:38","movieId":14,"attributes":["Apéro Film"],"iframeUrl":"https://www.kinoheld.de/kino/tuebingen/kino-museum-tuebingen/show/81794?mode=widget&cid=NDM5MzUwMA&layout=movies&design=new&rb=0&showId=81794&sessid=7qn2dsisl0euducg24q7drrbng"}]}]}]}]},{"id":15,"title":"Die Eiskönigin - Völlig unverfroren","slug":"die-eiskoenigin-voellig-unverfroren","duration":"102 min","fsk":"0","genre":"Komödie, Abenteuer, Action, Familienfilm","originalTitle":"Frozen","production":"Vereinigte Staaten","releaseDate":"28.11.2013","distributor":"Walt Disney Studios Motion Pictures Germany GmbH","director":"Chris Buck, Jennifer Lee","description":"Seit das Land von der Eiskönigin in einen ewig währenden, alles erfrierenden Winter gestürzt wurde, leben die Bewohnerinnen und Bewohner des Königsreichs in einer Welt aus Schnee. Die junge Anna macht sich deshalb auf den Weg, um den Bann des Frostes zu brechen und den Menschen Sonne, Licht und Wärme zurückzubringen. Doch ihre Reise wird nicht nur zu einem Abenteuer voller kleiner und großer Gefahren, sondern auch zu einem Wettlauf gegen die Zeit.<br><br>Zusätzlich stehen ihnen noch das treue Rentier Sven und der tollpatschige Schneemann Olaf (Josh Gad) zur Seite. Ihr Vorhaben kann ihnen nur gelingen, wenn sie Annas Schwester Elsa (Idina Menzel), die mittlerweile als Schneekönigin bekannt ist, ausfindig machen und besiegen. Auf ihrer wagemutigen Reise müssen sie gegen geheimnisvolle Kreaturen ankämpfen, sich gegen scharze Magie durchsetzen und dem Angriff der Elemente strotzen. Hinter jeder Ecke lauert eine neue Gefahr und ihre Reise wird zum Wettlauf gegen die Zeit.","posterU